display:flex;
margin: 10vw 0vw 5vw 0vw;
padding-bottom: 0px;
flex-direction:column;
width:100%;
@media (min-width: 1px) and (max-width: 426px) {
 width:100%;
 }
`

const ProjectImg =styled.img`
width:100%;
height:100%;
`
const ProjectImgHolder =styled.div`
width:35vw;
height:15vw;
margin: 5vw 0vw 5vw 0vw;
`
const ProjectHeading =styled.h1`
font-size:6vw;
color:white;
font-family:arial;
font-weight:bolder;
`

const Heading =styled.h1`
font-size:1vw;
color:white;
font-family:arial;
margin: 0.5vw 0vw 0.5vw 0.5vw;
font-weight:bolder;
`

class Gallery extends Component {

  render() {



    return (

      <div className="row">

  <Holder data-aos='slide-up' data-aos-duration="1200"> 
      <HolderInner>
      <ProjectHeading  >Kkwe</ProjectHeading>
  <Heading  >Website - Events Planner</Heading>
  <Heading  >REACT.JS - AOS </Heading>

  </HolderInner>
  <ProjectImgHolder>
  <ProjectImg src={Kkwe} alt=""/>
  </ProjectImgHolder>
          </Holder>

          <Holder data-aos='slide-up' data-aos-duration="1200"> 
      <HolderInner>
      <ProjectHeading >Kkwe</ProjectHeading>
  <Heading >Website - Events Planner</Heading>
  <Heading >REACT.JS - AOS </Heading>

  </HolderInner>
  <ProjectImgHolder>
  <ProjectImg src={Kkwe} alt=""/>
  </ProjectImgHolder>
          </Holder>

      </div>
    );
  }
}
export default Gallery;
